  long average = total1 / num\_readings;

  // reset the scale to 0:
  scale.tare(average);

  long average2 = scale.get\_average(5);

  // calculate the weight in Newtons
  float newtons = average2 * calibration\_factor;

  if (newtons < 0) {
    newtons = 0.0;
  }

